import styled from 'styled-components';

export const HomeContainer = styled.div`
	min-width:1000px;
	width: 90%;
	margin: 0 auto;
	height: 200px;
	background:#ccc;
	overflow:hidden;
`;

export const LeftContainer = styled.div`
	float:left;
	width:65%;
	height:400px;
	background:red;
`;

export const RightContainer = styled.div`
	float: right;
	width:32%;
	height:400px;
	background:green;
`;
